See NO Evil with Mia Farrow (1971)




Sarah is a blind girl who has returned to her home, a country manor in which all of the occupants are dead. She unknowingly sleeps overnight, among a houseful of corpses, arising the next morning to quietly creep out of bed, in order not to awaken the other members of the household



Sarah (Farrow) is onlangs door een paardrij-ongeluk blind geworden. Nadat ze een bezoek aan haar ex-geliefde heeft gebracht komt ze thuis bij haar oom. Ze woont een tijdje bij hem en zijn familie totdat ze beter heeft leren leven met haar handicap. Wat Sarah niet weet of kan zien is dat de hele familie is vermoord door een indringer...



